import { Button, FormControl, Grid, InputLabel, MenuItem, Select, Table, TableBody, TableCell, TableContainer, TableHead, TableRow, TextField } from '@mui/material';
import React, { useState } from 'react';

const PaginaEnderecos = () => {
    const [tipoPessoa, setTipoPessoa] = useState('pessoaFisica');
    const [input1, setInput1] = useState('');
    const [input2, setInput2] = useState('');
    const [enderecos, setEnderecos] = useState([{ endereco: "Rua Belo Horizonte, 2830", residencial: true }, { endereco: "Rua Belo Horizonte, 2830", residencial: false }]);

    const handleChange = (event) => {
        setTipoPessoa(event.target.value);
    };

    const handleAddEndereco = () => {
        setEnderecos([...enderecos, { endereco: 'Novo EndereÃ§o' }]);
    };

    const handleRemoveEndereco = (index) => {
        const updatedEnderecos = [...enderecos];
        updatedEnderecos.splice(index, 1);
        setEnderecos(updatedEnderecos);
    };

    return (
        <div className="user-details">
            <h1>Inserir novo usuÃ¡rio</h1>
            <Grid container spacing={2} alignItems="center">
                {/* Select e 2 inputs na mesma linha */}
                <Grid item xs={4}>
                    <FormControl fullWidth>
                        <InputLabel id="tipo-pessoa-label">Tipo de Pessoa</InputLabel>
                        <Select
                            labelId="tipo-pessoa-label"
                            id="tipo-pessoa"
                            value={tipoPessoa}
                            onChange={handleChange}
                        >
                            <MenuItem value="pessoaFisica">Pessoa FÃ­sica</MenuItem>
                            <MenuItem value="pessoaJuridica">Pessoa JurÃ­dica</MenuItem>
                        </Select>
                    </FormControl>
                </Grid>
                <Grid item xs={4}>
                    <TextField
                        label="Input 1"
                        fullWidth
                        value={input1}
                        onChange={(e) => setInput1(e.target.value)}
                    />
                </Grid>
                <Grid item xs={4}>
                    <TextField
                        label="Input 2"
                        fullWidth
                        value={input2}
                        onChange={(e) => setInput2(e.target.value)}
                    />
                </Grid>

                {/* 2 inputs em outra linha */}
                <Grid item xs={6}>
                    <TextField label="Input 3" fullWidth />
                </Grid>
                <Grid item xs={6}>
                    <TextField label="Input 4" fullWidth />
                </Grid>
            </Grid>

            <TableContainer component={Paper}>
                <Table>
                    <TableHead>
                        <TableRow>
                            <TableCell>Nome</TableCell>
                            <TableCell>CPF/CNPJ</TableCell>
                            <TableCell>Telefone</TableCell>
                            <TableCell>Email</TableCell>
                            <TableCell>EndereÃ§os Comerciais</TableCell>
                            <TableCell>EndereÃ§os Residenciais</TableCell>
                            <TableCell>AÃ§Ãµes</TableCell>
                        </TableRow>
                    </TableHead>
                    <TableBody>
                        {users.map((user) => (
                            <TableRow key={user.id}>
                                <TableCell>{user.name}</TableCell>
                                <TableCell>{user.cpf_cnpj}</TableCell>
                                <TableCell>{user.phone}</TableCell>
                                <TableCell>{user.email}</TableCell>
                                <TableCell className='address'>{user.businessAddresses}</TableCell>
                                <TableCell className='address'>{user.residentialAddresses}</TableCell>
                                <TableCell className='buttons'>
                                    <Button variant="contained" color="primary">Editar</Button>
                                    <Button className='btn-remove' variant="contained" color="error">Excluir</Button>
                                </TableCell>
                            </TableRow>
                        ))}
                    </TableBody>
                </Table>
            </TableContainer>

            <Button variant="contained" color="primary">Salvar</Button>
        </div>
    );
};

export default PaginaEnderecos;
